import styled from "styled-components";
import { ReactComponent as Check } from "../Img/ei_check.svg";

interface TODOOBJ {
  name: string;
  tag: string;
  color: string;
}

const TodoList = styled.li`
  display: flex;
  width: 100%;
  height: 100px;
  min-height: 100px;
  background: var(--white);
  border-radius: 30px;
  padding: 10px;
  align-items: center;
`;

// const CheckBtn = styled.button`
//   width: auto;
//   height: auto;
// `;

const CheckImg = styled(Check)`
  width: auto;
  height: auto;
  background-color: black;
  path {
    fill: black;

  }

  & :hover {

    background-color: black;

    background: black;
    fill : white;

  }


  }
`;

export default function TodoLi(props: { todo: TODOOBJ }) {
  const { name, tag, color } = props.todo;
  return (
    <TodoList>
      <CheckImg />
      {name} {tag} {color}
    </TodoList>
  );
}
